// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./IWanderTokenPol.sol";

contract Request {
    IWanderTokenPol wanderTokenPolInterface;
    address wanderTokenPolAddress;
    Request[] public requests;
    address[] public admins;
    uint public numConfirmationsRequired;
    mapping(address => bool) public isAdmin;

     // Events emitted after the execution a request 
    event SubmitRequest(address indexed owner, uint indexed txIndex, address indexed to, uint value, uint method);
    event ExecuteRequest(address indexed owner, uint indexed txIndex, uint method);

    // Required variables
    struct Request{
        address from;
        address to;
        uint value;
        uint method;
        bool executed;
        address[] confirmedAddress;
        uint numConfirmations;
    }

    // Required Modifiers and Involving Function Acting as Modifiers
    modifier onlyAdmin(){
        require(isAdmin[msg.sender], "not admin");
        _;
    }
    modifier reqExistsAndNotExecuted(uint _reqIndex) {
        require(_reqIndex < requests.length, "request does not exist");
        require(!requests[_reqIndex].executed, "request is executed");
        _;
    }
    modifier fullyConfirmed(uint _reqIndex) {
        require(requests[_reqIndex].numConfirmations >= numConfirmationsRequired, "lack the required num of confirmations");
        _;
    }
    function callerConfirmed(uint _reqIndex) public view virtual onlyAdmin returns(uint){
        uint index = 100;   // Error counter, if it returns 100, then the address has not confirmed
        for (uint i; i< requests[_reqIndex].confirmedAddress.length;i++){
          if (requests[_reqIndex].confirmedAddress[i] == msg.sender){
              index = i;
              break;
          }
        }
        return index;   // Return the index of the caller's address in the requests' array of confirm addresses
    }

    // Replacement to Constructor
    function init(address[] memory _admins, uint _numConfirmationsRequired, address _wanderTokenPolAddress) public virtual{
        require(_admins.length > 0, "more than 1 owner is required");
        require(_numConfirmationsRequired > 0 && _numConfirmationsRequired <= _admins.length, "invalid number of confirmations");
        wanderTokenPolInterface = IWanderTokenPol(_wanderTokenPolAddress);
        wanderTokenPolAddress = _wanderTokenPolAddress;
        for (uint i = 0; i < _admins.length; i++){
            require(_admins[i] != address(0), "owner can't be the 0 address");
            require(!isAdmin[_admins[i]], "owner not unique");

            isAdmin[_admins[i]] = true;

            wanderTokenPolInterface.setRole(_admins[i]);
            admins.push(_admins[i]);
        }
        numConfirmationsRequired = _numConfirmationsRequired;
    }

    // Required Getter Methods
    function getTotalRequests() public view virtual onlyAdmin returns (uint256) {
        return requests.length;
    }
    function requestDetails(uint256 _reqIndex) public view virtual onlyAdmin returns (address, address, uint, uint, uint, bool) {
        return(requests[_reqIndex].from,
        requests[_reqIndex].to,
        requests[_reqIndex].value, 
        requests[_reqIndex].method, 
        requests[_reqIndex].numConfirmations, 
        requests[_reqIndex].executed);
    }

    // Functions involved in the execution process of request
    function submitRequest(address _to, uint _value, uint _method) public onlyAdmin {
        require(!(_value < 1000000 * 10 * 18 && ((_method == 2) || (_method == 3))), "use the regular mint or transfer method");
        require((requests.length < 10 || _method == 6), "clear the pool before submitting a new one");
        Request storage newRequest = requests.push();
        newRequest.from = msg.sender; 
        newRequest.to = _to; 
        newRequest.value = _value;
        newRequest.method = _method;
        newRequest.executed = false;
        newRequest.confirmedAddress.push(msg.sender);
        newRequest.numConfirmations = 1;
        emit SubmitRequest(msg.sender, requests.length, _to, _value, _method);
    }
    function confirmRequest(uint _reqIndex) public onlyAdmin reqExistsAndNotExecuted(_reqIndex) {
        require((callerConfirmed(_reqIndex) == 100), "req is confirmed");
        requests[_reqIndex].confirmedAddress.push(msg.sender);
        requests[_reqIndex].numConfirmations += 1;
    }
    function revokeConfirmRequest(uint _reqIndex) public onlyAdmin reqExistsAndNotExecuted(_reqIndex) {
        uint index = callerConfirmed(_reqIndex);
        require((index != 100), "req not confirmed");
        Request storage request = requests[_reqIndex];
        request.confirmedAddress[index] =request.confirmedAddress[request.confirmedAddress.length-1];
        request.confirmedAddress.pop();
        request.numConfirmations -= 1;
    }
    function executeRequest(uint _reqIndex) public virtual onlyAdmin reqExistsAndNotExecuted(_reqIndex) fullyConfirmed(_reqIndex){
        Request storage request = requests[_reqIndex];
        if (request.method == 0) {
            addAdmin(requests[_reqIndex].to, _reqIndex);
        }
        if (request.method == 1) {
            removeAdmin(request.to, _reqIndex);
        }
        if (request.method == 2) {
            wanderTokenPolInterface.transferRequest(request.from, request.to, request.value);
        }
        if (request.method == 3) {
            wanderTokenPolInterface.mint(request.to, request.value);
        }
        if (request.method == 4) {
            wanderTokenPolInterface.pause();
        }
        if (request.method == 5) {
            wanderTokenPolInterface.unpause();
        }
        request.executed = true;
        emit ExecuteRequest(msg.sender, _reqIndex, request.method);
        if (request.method == 6) {
            delete requests;  
        }
    }

    // //Functions involved in addition/removal of admin
    function addAdmin(address _newAdmin, uint _reqIndex) public onlyAdmin reqExistsAndNotExecuted(_reqIndex) virtual {
        require(admins.length <= numConfirmationsRequired + 2, "maximum number of admins are allowed");
        require(requests[_reqIndex].method == 0, "request method does not match");
        require(!isAdmin[_newAdmin], "admin not unique");
        uint emptyIndex = 100;
        for (uint i = 0; i < admins.length; i++){
            if (admins[i] == address(0)){
                emptyIndex = i;
                break;
            }
        }
        if (emptyIndex != 100){
            admins[emptyIndex] = _newAdmin;
        }
        else {
            admins.push(_newAdmin);
        }
        isAdmin[_newAdmin] = true;
        wanderTokenPolInterface.setRole(_newAdmin);
    }
    function removeAdmin(address _removedAdmin, uint _reqIndex) public onlyAdmin reqExistsAndNotExecuted(_reqIndex) fullyConfirmed(_reqIndex) virtual {
        require(admins.length >= numConfirmationsRequired, "minimum of number of admins are not met");
        require(requests[_reqIndex].method == 1, "request method does not match");
        for (uint i = 0; i <= admins.length; i++){
            if (admins[i] == _removedAdmin){
                admins[i] = address(0);
                break;
            }
        }
        isAdmin[_removedAdmin] = false;
        wanderTokenPolInterface.removeRole(_removedAdmin);
    }

    function test() public view returns(address){
        return wanderTokenPolAddress;
    }
}
